import React from 'react'
import { Button, StyleSheet, Text, View , FlatList , TouchableOpacity } from 'react-native'
const Data = [
    {
        id : 1 ,
        nama : "Salman Damanhuri" ,
        message : "Kuy Main" ,
        prodi : "T.Informatika" ,
        jam : "22.21 PM"
    }  ,
    
    {
        id : 2 ,
        nama : "Joko" ,
        message : "Kuy Main ML" ,
        prodi : "T.Industri" ,
        jam : "2.01 AM"
    } ,
    
    {
        id : 3 ,
        nama : "Budi" ,
        message : "Kuy Main Dota" ,
        prodi : "T.Mesin" ,
        jam : "6.21 PM"
    } ,
    
    {
        id : 4 ,
        nama : "Andi" ,
        message : "Kuy Main Papji" ,
        prodi : "T.Perkapalan" ,
        jam : "5.21 AM"
    }
]

const home = ({navigation}) => {
    const renderItem = ({item}) => (
        <View style={styles.container}>
            <TouchableOpacity>
                <Text>{item.nama}</Text>
                <Text>{item.prodi}</Text>
                <Text>{item.jam}</Text>
            </TouchableOpacity>
        </View>

    )
    
    return (
        <View style={styles.main}>
            <Text>Home</Text>
            <FlatList 
                data={Data}
                renderItem={renderItem}
                keyExtractor={(item) => item.id}
            />
        </View>
    )
}

export default home

const styles = StyleSheet.create({
    main : {
        padding : 15 
    } ,
    container : {
        marginVertical : 8
    }
})
